(3, 1, '2018-08-07 23:00:18', '2018-08-07 23:00:18', '<h2>Qui√©nes somos</h2><p>La direcci√≥n de nuestra web es: http://localhost:8080.</p><h2>Qu√© datos personales recogemos y por qu√© los recogemos</h2><h3>Comentarios</h3><p>Cuando los visitantes dejan comentarios en la web, recopilamos los datos que se muestran en el formulario de comentarios, as√≠ como la direcci√≥n IP del visitante y la cadena de agentes de usuario del navegador para ayudar a la detecci√≥n de spam.</p><p>Una cadena an√≥nima creada a partir de tu direcci√≥n de correo electr√≥nico (tambi√©n llamada hash) puede ser proporcionada al servicio de Gravatar para ver si la est√°s usando. La pol√≠tica de privacidad del servicio Gravatar est√° disponible aqu√≠: https://automattic.com/privacy/. Despu√©s de la aprobaci√≥n de tu comentario, la imagen de tu perfil es visible para el p√∫blico en el contexto de su comentario.</p><h3>Medios</h3><p>Si subes im√°genes a la web deber√≠as evitar subir im√°genes con datos de ubicaci√≥n (GPS EXIF) incluidos. Los visitantes de la web pueden descargar y extraer cualquier dato de localizaci√≥n de las im√°genes de la web.</p><h3>Formularios de contacto</h3><h3>Cookies</h3><p>Si dejas un comentario en nuestro sitio puedes elegir guardar tu nombre, direcci√≥n de correo electr√≥nico y web en cookies. Esto es para tu comodidad, para que no tengas que volver a rellenar tus datos cuando dejes otro comentario. Estas cookies tendr√°n una duraci√≥n de un a√±o.</p><p>Si tienes una cuenta y te conectas a este sitio, instalaremos una cookie temporal para determinar si tu navegador acepta cookies. Esta cookie no contiene datos personales y se elimina al cerrar el navegador.</p><p>Cuando inicias sesi√≥n, tambi√©n instalaremos varias cookies para guardar tu informaci√≥n de inicio de sesi√≥n y tus opciones de visualizaci√≥n de pantalla. Las cookies de inicio de sesi√≥n duran dos d√≠as, y las cookies de opciones de pantalla duran un a√±o. Si seleccionas &quot;Recordarme&quot;, tu inicio de sesi√≥n perdurar√° durante dos semanas. Si sales de tu cuenta, las cookies de inicio de sesi√≥n se eliminar√°n.</p><p>Si editas o publicas un art√≠culo se guardar√° una cookie adicional en tu navegador. Esta cookie no incluye datos personales y simplemente indica el ID del art√≠culo que acabas de editar. Caduca despu√©s de 1 d√≠a.</p><h3>Contenido incrustado de otros sitios web</h3><p>Los art√≠culos de este sitio pueden incluir contenido incrustado (por ejemplo, v√≠deos, im√°genes, art√≠culos, etc.). El contenido incrustado de otras web se comporta exactamente de la misma manera que si el visitante hubiera visitado la otra web.</p><p>Estas web pueden recopilar datos sobre ti, utilizar cookies, incrustar un seguimiento adicional de terceros, y supervisar tu interacci√≥n con ese contenido incrustado, incluido el seguimiento de tu interacci√≥n con el contenido incrustado si tienes una cuenta y est√°s conectado a esa web.</p><h3>Anal√≠tica</h3><h2>Con qui√©n compartimos tus datos</h2><h2>Cu√°nto tiempo conservamos tus datos</h2><p>Si dejas un comentario, el comentario y sus metadatos se conservan indefinidamente. Esto es para que podamos reconocer y aprobar comentarios sucesivos autom√°ticamente en lugar de mantenerlos en una cola de moderaci√≥n.</p><p>De los usuarios que se registran en nuestra web (si los hay), tambi√©n almacenamos la informaci√≥n personal que proporcionan en su perfil de usuario. Todos los usuarios pueden ver, editar o eliminar su informaci√≥n personal en cualquier momento (excepto que no pueden cambiar su nombre de usuario). Los administradores de la web tambi√©n pueden ver y editar esa informaci√≥n.</p><h2>Qu√© derechos tienes sobre tus datos</h2><p>Si tienes una cuenta o has dejado comentarios en esta web, puedes solicitar recibir un archivo de exportaci√≥n de los datos personales que tenemos sobre ti, incluyendo cualquier dato que nos hayas proporcionado. Tambi√©n puedes solicitar que eliminemos cualquier dato personal que tengamos sobre ti. Esto no incluye ning√∫n dato que estemos obligados a conservar con fines administrativos, legales o de seguridad.</p><h2>D√≥nde enviamos tus datos</h2><p>Los comentarios de los visitantes puede que los revise un servicio de detecci√≥n autom√°tica de spam.</p><h2>Tu informaci√≥n de contacto</h2><h2>Informaci√≥n adicional</h2><h3>C√≥mo protegemos tus datos</h3><h3>Qu√© procedimientos utilizamos contra las brechas de datos</h3><h3>De qu√© terceros recibimos datos</h3><h3>Qu√© tipo de toma de decisiones automatizada y/o perfilado hacemos con los datos del usuario</h3><h3>Requerimientos regulatorios de revelaci√≥n de informaci√≥n del sector</h3>', 'Pol√≠tica de privacidad', '', 'trash', 'closed', 'open', '', 'politica-privacidad__trashed', '', '', '2018-08-07 23:31:50', '2018-08-07 23:31:50', '', 0, 'http://localhost:8080/?page_id=3', 0, 'page', '', 0),
