(75, 1, '2018-08-09 23:56:59', '2018-08-09 23:56:59', 'El Shiatsu es una t√©cnica en la que utilizando los dedos y palma de¬†la mano se aplican presiones sobre la superficie de la piel con el fin de corregir desequilibrios del cuerpo, mantener y promover la¬†salud. Tambi√©n es un m√©todo que contribuye a la curaci√≥n de¬†enfermedades espec√≠ficas. Tiene un valor de $35.000.', 'Masaje Shiatsu', '', 'publish', 'open', 'open', '', 'masaje-shiatsu', '', '', '2018-08-09 23:56:59', '2018-08-09 23:56:59', '', 0, 'http://localhost:8080/?p=75', 0, 'post', '', 0),
