(77, 1, '2018-08-10 00:01:21', '2018-08-10 00:01:21', '¬°Ayer So√±√© con Valpara√≠so!\r\n\"El hotel de la calle H√©ctor calvo se destaca por el buen gusto de las¬†habitaciones decoradas con muebles Art Dec√≥ y denominadas con los nombres de los cerros de Valpara√≠so: Bar√≥n, Bellavista, Florida y¬†Mariposas. Tambi√©n est√°n las habitaciones Bah√≠ a, Los Poetas, Esmeralda y Prat en las que reina el silencio, la fragancia a s√°ndalo¬†y un ambiente acogedor.\r\nEl comedor de la casa refleja la atm√≥sfera de los ambientes¬†elegantes de las casas porte√±as en el pasado, lo mismo el sal√≥n¬†principal en el que resalta la maravillosa chimenea de cer√°mica¬†que construy√≥ su due√±o original. As√≠ mismo, en las paredes y bajo¬†las enormes vigas a la vista hay incrustaciones de azulejos que¬†brindan al espacio un ambiente hogare√±o. Tambi√©n en el √∫ltimo¬†piso hay un recinto encristalado lleno de plantas y mosaicos, con¬†una sorprendente vista al puerto.\r\nAl bajar el jard√≠n escalonado hay vistas espl√©ndidas a los cerros en¬†medio de naranjos, nogales, limoneros, n√≠speros, papayos, paltos,¬†cerezos y duraznos, todo en medio de peque√±as fuentes de aires¬†andaluces. La bajada de los √°rboles contin√∫a por la quebrada¬†hasta la ladera donde se encuentra el primitivo Castillo Collado con¬†su leyenda pret√©rita y un balc√≥n natural abierto a los cerros y a la¬†Sebastiana en altura. El conjunto de castillos y jardines que recibe¬†el nombre de Villa Hispania es un ejemplo del esfuerzo de los¬†inmigrantes espa√±oles en Valpara√≠so\".\r\n- Manuel Pe√±a Mu√±oz', 'M√°s sobre el castillo', '', 'publish', 'open', 'open', '', 'mas-sobre-el-castillo', '', '', '2018-08-10 00:01:21', '2018-08-10 00:01:21', '', 0, 'http://localhost:8080/?p=77', 0, 'post', '', 0),
